import React from "react";
import "./Piece.css";

class Piece extends React.Component {
	constructor(props) {
		super(props);
		this.number = props.number;
		this.state = {}
	}

	render() {
		let theId = "_" + this.number;
		return (
			<div>
				<div className="piece" draggable="true" data-number={this.number} id={this.number}>
				{this.number}
				</div>
			</div>
			);
	}
}

export default Piece;
